import { useParams } from 'react-router-dom';

import EventItem from '../components/EventItem';

export const EventDetailPage = () => {
	const params = useParams();

	console.log(params);

	return (
		<>
			<h1>EventDetail</h1>
			<EventItem event={params} />
		</>
	);
};
